INSERT INTO `cmsc132_fall2005` VALUES (1,2,5,4,2,5,3,'I feel it is not a very accurate representation of working in the industry at least at the few places I\'ve seen.  Usually tests will not be done right away, and the programmer tries his best to make his code correct on his own.  I feel we don\'t get a very good impression of proper, incremental design.  Instead we are encourages to rush ahead and complete the project enough to run the submit server tests, then go back and fix the bugs in brings up.','In one way I\'d like more secret tests, but I don\'t like what that would do to my grade.'),(2,4,5,4,4,5,4,'No, the feedback is great.','No secret tests that aren\'t spelled out in a project specification.'),(3,5,5,5,5,3,1,'No','Alow more tokens and detailed results'),(4,3,3,1,4,1,3,NULL,'Remove tokens on secret tests'),(5,4,4,4,5,2,5,'Nope.','More release tests.  2 more?'),(6,4,5,4,4,4,5,'Having release and secret tests that we can\'t see the code of makes it so that we may not even understand whats being tested.','No'),(7,3,5,2,4,2,1,'No.','More Release Tokens / Better Error Feedback'),(8,4,5,4,3,2,5,'The student may not see what is actually being tested.  In the real world, one may not know what is causing an error, but there are also tests that the programmer will know is being made, and exactly what it is testing.  Perhaps including both tests where we see exactly whas is being tested as well as private tests could be helpful.','Generally a godo experience.  Perhaps better feedback after the project has been graded.'),(9,5,5,4,5,4,1,'No.','Would we be able to get more submissions on submit server for release testing?'),(10,4,4,2,2,2,5,'No','Have the release tests show exactly what they are testing.'),(11,5,1,5,5,4,5,'no','Allow us to see all tests including the secret ones.'),(12,3,5,2,4,1,5,'Mechanical feedback doesn\'t help identify problem areas.','Increase no. % release tests tokens.'),(13,5,5,4,3,2,5,'It seemed that we would tweak the projects just enough for it to past the release tests, even if the code looked bad/was flawed somewhere, it didn\'t matter as long as it passed the release tests.','Nope.'),(14,4,2,2,4,3,4,'No, except maybe when the server didn\'t work.','None as of now.  But if I do I will email teachers.'),(15,4,5,2,4,3,2,'If the server goes down (as it has before) it can mean bad things for grades','A fail state against a crash would be nice but overall it is good.'),(16,4,5,5,4,4,4,'Usuall the error messages didn\'t tell you why it didn\'t work.','Better ability to say where program failed.'),(17,3,1,3,2,2,5,'Those who have less frequent access to the technology are able to test less often due to the 24-hr frequency.  Without release testing the project must be written to specification without an official test.','I used the test classes included in the project/along with my own tests...  I didn\'t use release testing until the very last project.  (and got an \"A\") :)'),(18,4,3,4,3,2,5,'NO','Give more detailed description about problems, and make server more stable.'),(19,4,5,4,4,2,2,'Yes because I think the only real way to correctly test a program is by having a person look at the code & test the code manually.','Make the release test descriptions more descsriptive'),(20,4,4,5,5,3,4,'I think that it would be more helpful to get more thorough feedback from the TAs after grading','tests that are more explanatory'),(21,4,5,4,5,4,3,NULL,'It would be nice to actually have access to the release tests and secret tests after a project was completed so that we could know exactly what went wrong if we failed some test.  I understand that their may be issues w/ smaller tests being used for multiple semesters, but I feel that knowing what went wrong in an implementation is something educationally valuable.'),(22,4,3,2,2,2,5,'No.  The server is reliable & precisely checks the program, so tat is all that should count','I\'ve noticed that you can\'t download the file you submitted, only the file you committed.  The server has problems allowing people to commit.  This is a disadvantage to people who work on multiple PCs.'),(23,4,5,4,3,2,2,'The messages generated are *sometimes* very cryptic and hard to cevipher so by using the submit server, you eliminate the human factor, and time is lost trying to pinpoint the problem.','- Make feedback easier to understand\r\n- make it master? (for release testing, etc.)'),(24,2,5,4,3,2,5,'NO EDUCATIONAL DISADVANTAGE, JUST PROBLEMS WITH SUBMISSIONS NOT REGISTERING','IDEA IS GOOD, JUST WORK MORE RELIABLY.  DON\'T FLAG PROJECTS AS SUBMITTED IF THEY AREN\'T'),(25,4,3,2,4,3,5,'Pretty stressful, All or nothing a lot of the time',NULL),(26,2,2,4,5,2,5,'no','include the secret tests on a pass/fail basis :)'),(27,3,4,4,2,3,1,'nope.  more positive since TA\'s have more time.','No.'),(28,4,5,4,4,3,NULL,'Not at all!','Avoid downtime issues, that\'s about it.  Maybe make test feedback clearer.'),(29,5,5,5,5,4,1,'NO','If it can give more feedback that will be great.'),(30,3,5,4,4,3,4,'Once it could not take my jar file because of the file\'s huge memory.',NULL),(31,3,4,1,3,2,5,'Naw...','Better feedback when you get an error'),(32,3,1,1,2,1,2,'Testing should be targetted (more anyway) to more advanced classes as opposed to 100 level classes.','We usually go by error and object when dealing with release tests because we are not clear on what\'s wrong with our project.'),(33,5,5,5,4,4,5,'I think it\'s a great tool to help with grading projects.  However, more time has to be devoted on human grading of the projects when it comes to style and algorithm performance.',NULL),(34,4,4,2,1,2,2,'We might end up not knowing how to write GOOD test cases.  In fact, we usually don\'t have to.','Hmm...  it not all that broken.  Just twik it.'),(35,5,5,5,5,4,4,'No','Possibly provide more detailed post grading feedback.'),(36,5,5,4,4,3,2,'No','Error reporting could be improved'),(37,5,3,5,4,2,5,'The instructor does not establish an understanding of the students style/problems.','More release tests!'),(38,4,2,4,2,4,4,'I think it works pretty well.','Make the testing qualities less rigid.  There should be room for small error.'),(39,5,5,5,5,4,5,'Maybe the submit server might stop us from learning how to test out own projects.  But the instructors were good because they taught us how to do J-Unit testing.  This was helpful.','Giving 5 tokens for release testing would be better.  Also giving partial credit could be helpful because often a project would have a minor problem and 20 points would be deducted.'),(40,4,4,4,4,4,4,'Pushes to get in the habit of planning for/preventing errors that aren\'t obvious first',NULL),(41,4,4,2,5,3,1,'No','Needs to be much more specific for all non-secret tests.  Need to know what is wrong with output, not just that it\'s wrong.'),(42,5,5,4,4,2,3,'No','have no secret tests, on release tests also have more detailed feedback on release tests'),(43,2,4,2,2,3,5,'No','1. more release tests\r\n2. less cryptic responses i.e. I would like to know WHY I\'m not passing a certain release test.  Otherwise they\'re useless'),(44,5,5,4,2,4,3,'No','No.  Although many students say it is better for release tests to be available for looking at them, I disagree.  It was good enough that release tests were provided at all.'),(45,4,5,4,4,3,4,NULL,'More release tokens for harder projects'),(46,4,5,3,2,1,5,'If your project does not do something 100% the way the server wants it, you end up getting 30% on the project, and it is like you never attempted the project, although the project does what it was supposed to do (scrolling marquee).  I was a few lines off and couldn\'t fix it, and spent 10+ hours on it.','Offer regrades for things such as above, graded by a human.  It is a great system, but needs a human to be watching it'),(47,3,4,3,4,2,1,'It provides less feedback than a human grader.  And as such less learning opportunity but the system works.','-'),(48,2,5,1,1,1,4,'RELEASE TESTS OFFERED VERY LITTLE FEEDBACK',NULL);
